import image from "./images/im5.jpeg";
import image1 from "./images/im6.jpg";
import { useState } from "react";

import "../node_modules/bootstrap/dist/css/bootstrap.css";
import { Link, useNavigate } from "react-router-dom";
import "./common.css";
import { toast } from "react-toastify";
import { signUp as signUpApi } from "./services/user";
import { log } from "./utils/utils";
import axios from "axios";
function Add() {
  const [branchName, setBranchName] = useState("");
  const [branchCode, setBranchCode] = useState("");
  const [branchLocation, setBranchLocation] = useState("");
  const [branchManager, setBranchManager] = useState("");
  const navigate = useNavigate();

  const signUp = async () => {
    debugger;

    if (firstName.length == "") {
      toast.error("Please enter first name");
    } else if (lastName.length == "") {
      toast.error("Please enter last name");
    } else if (email.length == "") {
      toast.error("Please enter email");
    } else if (mobile.length == "") {
      toast.error("Please enter mobile");
    } else if (password.length == "") {
      toast.error("Please enter password");
    } else if (confirmPassword.length == "") {
      toast.error("Please confirm password");
    } else if (password !== confirmPassword) {
      toast.error("Password does not match");
    } else {
      const response = await signUpApi(
        firstName,
        lastName,
        email,
        password,
        mobile,
        gender,
        branchId,
        role
      );


      if (response.status === true) {
        toast.success("Successfully registered a new user");
        log(response.data);
        // go back to login
        navigate("/");
      } else {
        toast.error("Error while registering a new user, please try again");
      }
    }
  };

  return (
    <div className="length">
      <div className="container">
        <div className="flex">
          <div className="of">
            <img src={image1} alt="" />
          </div>
          <div className="sp"></div>
          <div>
            <table className="colr">
              <tr>
                <td>Enter Branch Name</td>
                <td className="td"></td>
                <td>
                  <input type="text" placeholder="Branch Name" value=""></input>
                </td>
              </tr>
              <tr className="tr"></tr>
              <tr>
                <td>Enter Branch Location</td>
                <td className="td"></td>
                <td>
                  <input
                    type="text"
                    placeholder="Branch Location"
                    value=""
                  ></input>
                </td>
              </tr>
              <tr className="tr"></tr>
              <tr>
                <td>Enter Branch Code</td>
                <td className="td"></td>
                <td>
                  <input type="text" placeholder="Branch Code" value=""></input>
                </td>
              </tr>
              <tr className="tr"></tr>
              <tr>
                <td>Enter Branch Manager</td>
                <td className="td"></td>
                <td>
                  <input
                    type="text"
                    placeholder="Branch Manager"
                    value=""
                  ></input>
                </td>
              </tr>
              <tr className="tr"></tr>
              <tr>
                <center>
                  <td>
                    <button className="btn btn-primary">Add Branch</button>
                  </td>
                </center>
              </tr>
            </table>
          </div>
          <div className="lsd">
            <table>
              <tr>
                <h3 className="colr">
                  Creating anew branch means increases a delivery efficiency
                </h3>

                <tr className="tr"></tr>
                <p>
                  Our target is to get 50 branch completed in one year and make
                  our Customer happy by providing a good services to them good
                  services means delivered a product on time
                </p>
              </tr>
              <tr className="tr"></tr>
              <tr>
                <img src={image} alt="" />
              </tr>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
}
export default Add;
